import { useEffect, useState } from 'react';
import {
  Alert,
  Box,
  Button,
  Grid,
  List,
  Paper,
  TextField,
  Typography
} from '@mui/material';
import api from '../../api';
import SongRow from '../../components/SongRow';

const defaultForm = {
  songName: '',
  song: '',
  artist: '',
  category: '',
  imgSrc: ''
};

const SongsAdmin = ({ onSelectTrack }) => {
  const [songs, setSongs] = useState([]);
  const [form, setForm] = useState(defaultForm);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [saving, setSaving] = useState(false);

  const loadSongs = async () => {
    try {
      setLoading(true);
      const { data } = await api.get('/songs');
      setSongs(data);
      setError(null);
    } catch (err) {
      setError('Failed to load songs');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadSongs();
  }, []);

  const handleChange = (event) => {
    const { name, value } = event.target;
    setForm((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    if (!form.songName || !form.song) {
      setError('Song name and URL are required');
      return;
    }

    try {
      setSaving(true);
      const payload = {
        songName: form.songName,
        song: form.song,
        artist: form.artist || undefined,
        category: form.category || undefined,
        imgSrc: form.imgSrc || undefined
      };
      const { data } = await api.post('/songs', payload);
      setSongs((prev) => [data, ...prev]);
      setForm(defaultForm);
      setError(null);
    } catch (err) {
      setError('Failed to create song');
    } finally {
      setSaving(false);
    }
  };

  const handleDelete = async (song) => {
    try {
      await api.delete(`/songs/${song._id}`);
      setSongs((prev) => prev.filter((item) => item._id !== song._id));
    } catch (err) {
      setError('Failed to delete song');
    }
  };

  return (
    <Box sx={{ display: 'flex', flexDirection: 'column', gap: 4 }}>
      <Paper sx={{ p: 3, borderRadius: 3 }}>
        <Typography variant="h5" gutterBottom>
          Add New Song
        </Typography>
        <Typography variant="body2" color="text.secondary" gutterBottom>
          Provide a direct MP3 URL and optional cover image. The seed script handles local files.
        </Typography>
        {error && (
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
        )}
        <Box component="form" onSubmit={handleSubmit} sx={{ mt: 2 }}>
          <Grid container spacing={2}>
            <Grid item xs={12} sm={6}>
              <TextField
                label="Song Name"
                name="songName"
                value={form.songName}
                onChange={handleChange}
                required
                fullWidth
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                label="Artist"
                name="artist"
                value={form.artist}
                onChange={handleChange}
                fullWidth
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                label="MP3 URL"
                name="song"
                value={form.song}
                onChange={handleChange}
                required
                fullWidth
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                label="Category"
                name="category"
                value={form.category}
                onChange={handleChange}
                placeholder="Optional"
                fullWidth
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                label="Cover Image URL"
                name="imgSrc"
                value={form.imgSrc}
                onChange={handleChange}
                placeholder="Optional"
                fullWidth
              />
            </Grid>
            <Grid item xs={12}>
              <Button type="submit" variant="contained" color="primary" disabled={saving}>
                {saving ? 'Saving...' : 'Add Song'}
              </Button>
            </Grid>
          </Grid>
        </Box>
      </Paper>

      <Box>
        <Typography variant="h5" gutterBottom>
          Current Songs
        </Typography>
        {loading ? (
          <Typography variant="body2" color="text.secondary">
            Loading songs...
          </Typography>
        ) : (
          <List sx={{ bgcolor: 'background.paper', borderRadius: 2 }}>
            {songs.map((song) => (
              <SongRow
                key={song._id}
                song={song}
                onPlay={onSelectTrack || (() => {})}
                onDelete={handleDelete}
                showDelete
              />
            ))}
          </List>
        )}
      </Box>
    </Box>
  );
};

export default SongsAdmin;
